import './App.css';
import { NewPage } from './component/NewPage';
import { Routes, Route } from 'react-router-dom';
import { data } from './data/data';

function App() {
  return (
    <Routes>
      <Route path='/pages/:id' element={<NewPage/>} />
      {data.map}
    </Routes>
  );
}

export default App;
